drop database if exists climate;

create database climate;

use climate;

CREATE TABLE hadcrut(
   Months         VARCHAR(7) NOT NULL PRIMARY KEY
  ,Years          INTEGER 
  ,AnnualGlobalC  NUMERIC(12,9)
  ,AnnualNorthC   NUMERIC(12,9)
  ,AnnualSouthC   NUMERIC(12,9)
  ,MonthlyGlobalC NUMERIC(12,9) NOT NULL
  ,MonthlyNorthC  NUMERIC(12,9) NOT NULL
  ,MonthlySouthC  NUMERIC(12,9) NOT NULL
);

CREATE TABLE v5(
   depht      NUMERIC(7,2) NOT NULL
  ,age_of_ice INTEGER  NOT NULL PRIMARY KEY 
  ,age_of_air INTEGER  NOT NULL
  ,co2_ppmv   NUMERIC(5,1) NOT NULL
);
